import { ReactTerminal } from "react-terminal";
import './App.css'


function App () {
  // Define commands here
  const commands = {
    whoami: "jackharper",
    cd: (directory) => `changed path to ${directory}`
  };

  return (

    <ReactTerminal
      commands={commands}
    />
  );

}

export default App;
